export default class Tasks extends Component
{
    constructor(props)
    {
        super(props)
    }




    render()
    { 
        return (<div style={{border:"2px violet solid"}}>
            Title: {this.props.todo.title} <br/><br/>
            Completed: <input type='text' value={this.props.todo.completed}/><br/><br/>
        </div>)
    }
}
